import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function Chat() {
  const { id } = useParams();

  useEffect(() => {
    axiosInstance
      .post(`/createChat`, {
        cid: localStorage.getItem("CustomerLogId"),
        drid: id,
      })
      .then((res) => {
        console.log(res, "create chat");
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
      .post(`/viewChatForDrwithCust/${id}`, {
        cid: localStorage.getItem("CustomerLogId"),
      })
      .then((res) => {
        console.log(res, "view chat");
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div>
      <div className="chatdiv" style={{ minHeight: "400px", padding:"100px"}}>
        <div style={{border:"2px solid black", borderRadius:"10px", minHeight:"300px"}}></div>
        <div class="mb-3">
          <input
            type="email"
            class="form-control"
            id="exampleFormControlInput1"
            placeholder="Enter your message"
          />
        </div>
      </div>
    </div>
  );
}

export default Chat;
